Customizing the payload of a JWT token in a MEAN stack application<p>In my web application, a user signs in and a token is created. Now i want to add a claim to the payload of this token: a boolean value for being an admin or not.</p>

<p>I've searched around the web, but i can't seem to find how to implement this in a Mean stack application.</p>

<p>My goal is when a user signs in, i can check if the user is an admin using the payload of the token. Then i can lock specific parts of my application so they are only accessible for admins.</p>

<p>This is the login function in the service</p>

<pre><code>function logIn(user) {
        return $http.post('/api/users/login', user, {
            headers: {
                Authorization: 'Bearer ' + getToken()
            }
        }).success(function(data) {
            saveToken(data.token);
        }).error(function(err){
          return err;
        });
    }
</code></pre>

<p>These are the functions to save the token and get the token from local storage:</p>

<pre><code>function saveToken(token) {
        $window.localStorage['ptlab-app-token'] = token;
    }
function getToken() {
        return $window.localStorage['ptlab-app-token'];
    }
</code></pre>

<p>And this is the function i use to check if a user is logged in in order to unlock specific parts of the application:</p>

<pre><code>function isLoggedIn() {
        var token = getToken();

        if (token) {
            var payload = angular.fromJson($window.atob(token.split('.')[1]));
            return payload.exp &gt; Date.now() / 1000;
        } else {
            return false;
        }
    }
</code></pre>

<p>So i want to do sort of the same as isLoggedIn with the admin check. But i can't seem to figure out how to customize the payload of the jwt token and add a claim to the payload. With a claim called "admin", i can easily check if the user is and admin without having to access the database.</p>

<p>Has anybody got any suggestions ?</p>

