Converting Mongo ID to String to do Comparison<p>I have a search feature that returns filtered data from my mongoDB based on a user's input for various filters. So, for instance I can do this and it works:</p>

<pre><code>if (lastName) {
    let arrlastName = [];
    arrlastName = lastName.split(",");
    _.each(arrlastName, (l, key, c) =&gt; {
        arrlastName[key] = new RegExp(arrlastName[key], "i");
    });
    search['name.last'] = { $in: arrlastName };
}
</code></pre>

<p>The above returns a filtered data set where the results match whatever was passed in by the user in a comma separated list.</p>

<p>However, I am running into a challenge in comparing a user inputed value with an <code>_id</code> value in our mongo db. Of course, the <code>_id</code> I'm checking against here is not a string, but a mongo objectId -- that's the issue as far as I can tell. So I'm trying to figure out how I can convert either the input, or the <code>_id</code>, or both, to do a valid comparison. This was the initial code:</p>

<pre><code>if (person) search['_id'] = person;
</code></pre>

<p>That doesn't work, because the value for <code>person</code> here is a string, and <code>_id</code> is not -- as I said, <code>_id</code> is a mongo objectId. So how can I do a type conversion to handle this check?</p>

<p>I tried this but it causes errors:</p>

<pre><code>if (person) search['_id'].toString() = person;
</code></pre>

<p>What would the syntax look like for this kind of comparison?</p>

