Evaluating an Array of MongoDB IDs<p>I have a search feature where filtered data is returned from my mongoDB based on a user's input for various filters. Here's an example, where records are returned that match for <code>lastName</code> values. This array of values is passed in to Mongoose/Mongo using <code>$in</code>:</p>

<pre><code>if (lastName) {
    let arrlastName = [];
    arrlastName = lastName.split(",");
    _.each(arrlastName, (l, key, c) =&gt; {
        arrlastName[key] = new RegExp(arrlastName[key], "i");
    });
    search['name.last'] = { $in: arrlastName };
}
</code></pre>

<p>The above code works as expected.</p>

<p>However, in addition to matching for names, I want to return records based on a filter that evaluates a user's "_id". The challenge is, "_id" here is not a string, but a mongoDB object Id.</p>

<p>Now, this is easy enough to do when I'm searching for a single value for "_id", in which case I would just do this:</p>

<pre><code>  if (personId) search['_id'] = new mongo.ObjectID(personId);
</code></pre>

<p>That also works as expected. This will return just the results that match this one <code>_id</code>.</p>

<p>But how do I evaluate against an array of values in this situation - like I'm doing for <code>lastName</code> in the code near the top of this question? What would that look like? This is what I tried (that did not work):</p>

<pre><code>  if (person) {
    let personId = new mongo.ObjectID(person);
    let arrPerson = [];
    arrPerson = personId.split(",");
    _.each(arrPerson, (l, key, c) =&gt; {
    arrPerson[key] = new RegExp(arrPerson[key], "i");
    });
    search['_id'] = { $in: arrPerson };
  }
</code></pre>

