Creating a many-to-many relationship in MongoDB/ Mogoose using nested fields?<p>I'm currently trying to wrap my head around creating a many-to-many relationship in mongodb/mongoose. </p>

<p>I have two Schemas:</p>

<pre><code>// User Schema
var UserSchema = mongoose.Schema({
    email: {
        type: String,
        index:true
    },
    name: {
        type: String
    },
    tasks:[{type:mongoose.Schema.ObjectId, ref: 'Tasks'}]
});
</code></pre>

<p>and </p>

<pre><code>// Tasks Schema
var TaskSchema = mongoose.Schema({
    name: {
        type: String,
        index: true
    },
    description: {
        type: String
    },
    status:{
        type: String
    },
});
</code></pre>

<p>The idea here, is that each user can take on a task and the task would have it's own status for each user (e.g. notStarted, inProgress, Complete, Failed). This status would change as the user progresses through the task. Each user would see the same tasks(i.e. name + description), but would have a different status associated with it. Additionally, each task has it's own status (Available, Hidden), which would dictate if the users can see the task or not. This would not be unique for each user. </p>

<p>This is my thought process so far: </p>

<p>I'm thinking that I can nest the objectIds of <strong>every</strong> task in with the user along with the status. For example: </p>

<pre><code>{
   email: "Bob@bob.com"
   name: "Bob",
   tasks: {
     { _id: 001, status: "Active"},
     {_id: 002, status: "inProgress"},
     { _id: 003, status: "Failed"}
   }
 },
 {
   email: "Mary@mary.com"
   name: "Mary",
   tasks: {
     { _id: 001, status: "Failed"},
