    name: {
        type: String,
        index: true
    },
    description: {
        type: String
    },
    status:{
        type: String
    },
});
</code></pre>

<p>The idea here, is that each user can take on a task and the task would have it's own status for each user (e.g. notStarted, inProgress, Complete, Failed). This status would change as the user progresses through the task. Each user would see the same tasks(i.e. name + description), but would have a different status associated with it. Additionally, each task has it's own status (Available, Hidden), which would dictate if the users can see the task or not. This would not be unique for each user. </p>

<p>This is my thought process so far: </p>

<p>I'm thinking that I can nest the objectIds of <strong>every</strong> task in with the user along with the status. For example: </p>

<pre><code>{
   email: "Bob@bob.com"
   name: "Bob",
   tasks: {
     { _id: 001, status: "Active"},
     {_id: 002, status: "inProgress"},
     { _id: 003, status: "Failed"}
   }
 },
 {
   email: "Mary@mary.com"
   name: "Mary",
   tasks: {
     { _id: 001, status: "Failed"},
     { _id: 002, status: "Active"},
     { _id: 003, status: "Active"}
   }
 }
</code></pre>

<p>However, this means that whenever I create a new task, I need to add it to the task list of <strong>all users</strong>, with the status set to a default (e.g. notStarted). Additionally whenever I add a new user, I need to get <strong>all tasks</strong> and add them to the user's list of tasks. </p>

<p>This seems sort of clunky to me, and I feel like there must be a better way. If this <em>is</em> the best way to do it, I'm not quite sure what I would use to write this. I was thinking maybe use <a href="https://docs.mongodb.com/master/reference/operator/aggregation/addFields/" rel="nofollow noreferrer">addFields</a> or would <a href="https://docs.mongodb.com/manual/reference/operator/update/push/#up._S_push" rel="nofollow noreferrer">Push</a> be more appropriate? Or would that create <a href="https://docs.mongodb.com/manual/tutorial/model-referenced-one-to-many-relationships-between-documents/" rel="nofollow noreferrer">arrays that grow without bound?</a> which might not be the best idea since it's a Mongo anti-pattern from what I've read?</p>

<p>I also found <a href="https://stackoverflow.com/questions/8330188/how-to-model-many-to-many-relationships-in-mongodb-for-a-mysql-user">this post</a> that's sort of related, but it's from ~6 years ago, and I think I need a little bit more depth or code examples. </p>

<p>Any help would be much appreciated! </p>; Answer: Thank you so much for this tutorial, it helped me a lot! I've implemented the `MyAdapter` class and then extended the `CickListener` interface with the 2 methods `onItemClick` and `onItemLongClick` and worked like a charm!

